    "<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nThe Rauhuff Connection:<br />\nSampson Rauhooft, possibly with kin Jacob Hooft, John Hooft (2), Joseph <br />\nHufft, Benjamin Hooft, and William Hooft (all probably misspelled by the <br />\n1830 census taker) moved into the Pigeon Forge community in Sevier <br />\nCounty, Tennessee sometime after 1800.  Later census takers would write <br />\nSampson's last name as \"Rauhuff\".   Records from Montgomery County and <br />\nGrayson County, Virginia, prove that Sampson's parents were Peter Rauhuff <br />\nand Lovis Sage Rauhuff.\n</p>\n<p>\nSampson apparently married a native Indian woman (more on this below) and <br />\nhad at least six children: Samuel (b. 1825-1830), another son (b. <br />\n1830-1835), Sarah Narcissus (b. 1833), Selena M. (b. August 11, 1836), <br />\nCaroline (b. 1830-1835), and Elizabeth (b. 1835-1840).  The childrens' <br />\nnames did not appear in any census, but were inferred from events that <br />\nare related below or were taken from the book \"The Rauhuffs\", by Bradford <br />\nRoy Rauhuff, 1994.  The family lived in Civil District 5, Sevier County <br />\n(Pigeon Forge).\n</p>\n<p>\nOne of the girls may have been named Mary, because the Boyd's Creek <br />\nCemetery has a Mary Rowhoff, born March 8, 1828, died September 3, 1859.  <br />\nIf so, she is named after her mother Polly, which name is a common <br />\nnickname for \"Mary\".  Although the dates don't quite match with the 1840 <br />\ncensus, errors of this type were often made.\n</p>\n<p>\nIn 1832, Sampson Rowhough joined the Forks of the Little Pigeon Baptist <br />\nChurch in Sevierville, Tennessee, one of the old-line, principal churches <br />\nof the area.  In 1833, Polly Rowhough was also admitted to membership.\n</p>\n<p>\nBy 1836, Sampson has moved to Knox County, Tennessee, just to the west of <br />\nSevier County, with the family as described in the household.  He must <br />\nhave bought land, because he appears on the Knox County tax list of 1836.\n</p>\n<p>\nIn 1840, Sampson appeared in the Knox County, Tennessee census as <br />\nfollows:  Males 01101, Females 220001 [Key: 0-5, 5-10, 10-15, 15-20, <br />\n20-30, 30-40]\n</p>\n<p>\nBy 1850, Sampson does not appear in any Tennessee census.  Bradford <br />\nRauhuff states that he moved to Missouri.\n</p>\n<p>\nJames Pinckney Rauhuff (b. March 1, 1862, d. February 7, 1947), a son of <br />\nSelena M. Rauhuff, was kept the last two years of his life in the home of <br />\nM. Ada Davenport Sharp and Paul Sharp.  He was a great uncle once removed <br />\nof Ada, and was affectionately referred to as \"Uncle Pink\".  He probably <br />\ntalked about his family a great deal, but only the following bare facts <br />\ncould be recalled by Ada:  Narcissus, Selena, and their older brother as <br />\nteenagers (before 1851) came to Sevier County from Norman, Oklahoma, by <br />\nthemselves, in a wagon.  [This is revealing, because the American Indians <br />\nhad been removed from East Tennesse to Oklahoma in 1838.  Possibly, they <br />\nhad moved to Missouri with their father, visited their kin in Oklahoma, <br />\nand returned to Sevier County. - Ed.]  Back in Sevier County, looking for <br />\nany place to stay, they settled for a time on the farm of William H. <br />\nCannon, who was old (about 80) at the time, in the Boyd's Creek <br />\ncommunity.  William H. Rauhuff was the offspring of Narcissus and William <br />\nH. Cannon.  These statements were substantially corroborated by Mary <br />\nMiranda Rauhuff Davenport, Ada's mother and a niece of Uncle Pink.\n</p>\n<p>\nIn 1850, William H. Cannon was keeping William H., Jr. and his wife <br />\nMary.  No children were present.  The census does not indicate Sampson <br />\nRauhuff's whereabouts, nor any of his children.  If  Sarah Narcissus and <br />\nSelena were on William Cannon's farm, they simply were not counted.  In <br />\n1860, William H. was keeping only William H., Jr., and James Wade, County <br />\nTrustee, age 25.  No women or children were indicated.  Both of William <br />\nH., Jr's wives were deceased. William, Jr. is listed as \"merchant.\"\n</p>\n<p>\nIn 1851, Narcissa, \"a woman of color\", joined the Forks of The Little <br />\nPigeon Baptist Church (FLPBC) in Sevierville.  (Recall that Sampson and <br />\nPolly, Narcissus' probable parents, were members at FLPBC when Narcissus <br />\nwould have been a child).  Selena M. is buried in the Shiloh Cemetery in <br />\nPigeon Forge, which was then associated with another of the principal <br />\nchurches in the area.  Sarah Narcissus' burial place is not known, and is <br />\nnot listed in a comprehensive survey of Sevier County cemeteries.\n</p>\n<p>\nAfter 1850, Selena and Narcissus moved to Civil District 5 (Pigeon Forge) <br />\nof Sevier County into a household with just themselves and their <br />\nchildren, where they appear in the 1860 and 1870 censuses.  Their <br />\nvocation in 1860 is listed as \"hireland\", which is to say \"field hand\".  <br />\nNarcissus had two children, and Selena had four.  It appears that they <br />\nnamed the boys after their consorts, who were themselves upright members <br />\nof the community.  For example, James Pinckney Rauhuff was named after <br />\nJames B. Seaton, the postmaster; William H. Rauhuff was named after <br />\nWilliam H. Cannon, a prominent farmer; and James Leon Rauhuff was named <br />\nafter James Leon Clabough, a store owner.\n</p>\n<p>\nSelena's daughter Priscilla was listed as \"attending school\" in the 1870 <br />\ncensus.  This is significant because there were only a very few children <br />\nin the entire county who were attending school at that time. The few <br />\nschools were called \"academies,\" and tuition had to be paid by the <br />\nparents.\n</p>\n<p>\nAmong the mementos left to Ada Sharp by Uncle Pink was a pencil portrait <br />\nof a teenage grandson and granddaughter of Selena Rauhuff.  This was <br />\nviewed by Clyde McCall Davenport sometime around 1979.  The two subjects <br />\nwere the children of one of the two daughters of Selena; time has erased <br />\nthe recall of which it was, but it had to be Rebecca (Priscilla had no <br />\ndaughters).  Either way, the portrait was very revealing, because it <br />\nshowed two strong, healthy, handsome, obviously Indian faces.  They <br />\nlooked much like Japanese athletes!  The artist captured a kind of a <br />\nglint to their expressions, as if to say \"Don't mess with me\".  Moreover, <br />\nseveral old photos exist of Uncle Pink, and he had the jet black hair and <br />\nhigh cheekbones of an American Indian.\n</p>\n<p>\nAfter the death of Ada Sharp, Clyde McCall Davenport approached her <br />\nhusband, Paul Sharp, about making a copy or photo of the portrait.  <br />\nUnfortunately, he could not find it.\n</p>\n<p>\nTo review the facts, Sampson moved to Knox County by 1836.  Sometime <br />\nbefore 1856, two teenaged girls named Rauhuff, along with an older <br />\nbrother,  came to Sevier County from Norman, Oklahoma, where the Indians <br />\nhad been taken.  They are not taken in by any family in the community, <br />\nbut are apparently left to fend for themselves.  Presumably, they must <br />\nhave been different in some way, as a person of Indian heritage would <br />\nhave been.  Some of their children and their grandchildren exhibited <br />\nstrong Indian features.  The Rauhuff women showed significant strength of <br />\ncharacter by being able to stay in the community and raise children under <br />\nthose circumstances.\n</p>\n</div>\n</div>",
