    "<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAlexander Preston Shults received a state land grant of 1,000 acres and <br />\nanother of 4,000 acres in the early 1840s.  This is the largest grant <br />\nknown to this author in Sevier County.   It is not clear to this author <br />\nupon what basis the grants were made.  Perhaps it was because his <br />\ngrandfather had participated in the Revolutionary War and his father in <br />\nthe War of 1812.  The land was bounded by the East Prong of the Pigeon <br />\nRiver, Webb's Creek, the Cocke/Sevier County line, and a line well up on <br />\nthe slope of the Western escarpment of the Smoky Mountains.  Shortly <br />\nafter 1870, Alexander Preston moved to Grainger County where the farm <br />\nland was much better and where some of his offspring lived.  From <br />\nhistorical documents, he had difficulty in selling all of his Sevier <br />\nCounty land.  William Williams (1843-1917) bought 600 acres from him at <br />\none dollar per acre.  The sales receipt, which my mother, Mamie Williams <br />\nDavenport (1911-), had in her possession in the 1970s was a simple <br />\nstatement of the acreage and selling price, handwritten on simple ruled <br />\nnotepad paper.  The Williams acreage was on the East side of the Shults <br />\nland grant, bounded by the original line on the mountain, the <br />\nCocke/Sevier county line, Dunn's Creek, and a line well down into Rocky <br />\nFlats.  See also state land grant to Phillip S. Shults.\n</p>\n</div>\n</div>",
