    "<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nIn an Anderson County will probate hearing (No. 312, December 17, 1872), <br />\nPhilip S. Shults' estate was said to include Tennessee State Grant 24671 <br />\n(half interest with Frederick Emert] 21 May 1842 for 4000 acres in Sevier <br />\ncounty bounded by Dunn's Creek and the Cocke County line, and Tennessee <br />\nState Grant 23913 [also half interest with Frederick Emert] 20 Aug 1841 <br />\nfor 2520 acres in Cocke County on the headwaters of Cosby Creek.  See <br />\nalso state grants to Alexander Preston Shults.\n</p>\n</div>\n</div>",
