    "<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nData on children from Williams family Bible, in possession of Leah Shults <br />\nLunsford, Rocky Flats Community, Fall 1979.<br />\nAlso data from original Collins Williams family bible in possession of <br />\nBessie Shults Anderson, 1998.<br />\nIn 1839 tax list Cocke County District 10.<br />\nIn 1840 Cocke Co, TN census:  11001-10001; Code: 5-10-15-20-30.<br />\nIn Cocke Co, TN in 1860 census.<br />\nCollins living alone, keeping g-daughter Elizabeth, 15, in 1870 Cocke <br />\nCounty census.<br />\nCollins had will, Sevier Co, TN, 1892.<br />\nWill mentions Sarah Ann, Sarah C., Jane, Lewis, Harriett, Elizabeth.\n</p>\n</div>\n</div>",
    "",
    "",
    "",
    "",
    "",
    "",
    "<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nWhen Dillard was 20, he was sentenced to two years in the state <br />\npenitentiary for \"malicious stabbing.\"  He served from December 22, 1841 <br />\nuntil December 22, 1843.  Conduct was \"fair.\"  He was married at the <br />\ntime.  (Records of the State Penitentiary)\n</p>\n<p>\nDillard joined the Union Baptist Church of Christ on Cosby Highway in <br />\n1849.  Church minutes note that he \"was in a fight with Jesse C. Holoway.\"\n</p>\n<p>\nThe 1850 Cocke Co, TN census lists\n</p>\n<p>\nWilliams, Julia     32<br />\nMary J.   10<br />\nMartha    8<br />\nWilliam   5<br />\nJohn 2<br />\nNancy     70\n</p>\n<p>\nWhere was Dillard?  They had more children after 1850.\n</p>\n<p>\nOral family history says that he was \"killed by Rebels\" on August 21, <br />\n1864, during the Civil War.\n</p>\n</div>\n</div>",
