    "<div>\n<i class=\"NoteType\">\nPerson Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nServed Private, E Co, Reg 1, 1st Tenn Light Artillery (Union) in Civil <br />\nWar, September 17, 1863<br />\nto August 1, 1865.<br />\nLived near present-day U.S. 321 highway at the Cocke-Sevier County line <br />\n(according to his<br />\ngranddaughter Mamie Williams Davenport).<br />\nIn Cocke County in 1870 census.<br />\nIn Sevier County in 1880 census.<br />\n1880 census lists only William, Sarah C., and Patterson C., 12; where <br />\nwere the rest?\n</p>\n<p>\nAlexander Preston Shults received a land grant of 1,000 acres and another <br />\nof 4,000 acres in the early 1840s.  This is the largest grant known to <br />\nthis author in Sevier County.   It is not clear to this author upon what <br />\nbasis the grants were made.  Perhaps it was because his father had <br />\nparticipated in the Revolutionary War.  The land was bounded by the East <br />\nProng of the Pigeon River, Webb's Creek, the Cocke/Sevier County line, <br />\nand a line well up on the slope of the Western escarpment of the Smoky <br />\nMountains.  Shortly after 1870, Alexander Preston moved to Grainger <br />\nCounty where the farm land was much better and where some of his <br />\noffspring lived.  From historical documents, he had difficulty in selling <br />\nall of his Sevier County land.  William Williams (1843-1921) bought 600 <br />\nacres from him at one dollar per acre.  The sales receipt, which my <br />\nmother, Mamie Williams Davenport (1911-), had in her possession in the <br />\n1970s was a simple statement of the acreage and selling price, <br />\nhandwritten on simple ruled notepad paper.  William's land lay along the <br />\nCocke/Sevier County line and extended from well up on the mountain to <br />\ndown almost to the Jones Cove Community.\n</p>\n</div>\n</div>",
